import React from 'react';


class Fish extends React.Component {
  render() {
    const {image, name} = this.props.details
    return (
      <div className="single-fish">
        <img src={img} alt={name} />
        <h3 className="fish-name">{this.props.details.name}</h3>
      </div>
    )
  }
}

export default Fish;
